import React from "react";
import MenuItem from "./MenuItem";
import AvaMenu from "./AvaMenu";
import Filter from "./Filter";

function MenuList({ menus }) {
  return (
    <div>
      <AvaMenu />
      <Filter />
      <div className="d-flex">
        {menus.map((menu) => (
          <MenuItem
            key={menu.id}
            id={menu.id}
            imageUrl={menu.image}
            title={menu.title}
            description={menu.description}
            {...menu}
          />
        ))}
      </div>
    </div>
  );
}

export default MenuList;
